import React from 'react';
import PropTypes from 'prop-types';
import { StyledModalFooter } from './Modal.styles';
const modalFooterPropTypes = {
    children: PropTypes.node.isRequired
};
const ModalFooter = ({ children }) => (React.createElement(StyledModalFooter, null, children));
ModalFooter.propTypes = modalFooterPropTypes;
export default ModalFooter;
//# sourceMappingURL=ModalFooter.js.map
